import './Nav.css';
import { Nav } from './Nav';
import { Snav } from './Snav';
import { Tnav } from './Tnav';
import { Fnav } from './Fnav';
import Item from './Item';
import { Footer } from './Footer';
import { Similar } from './Similar';
import Cart from './Cart';

function App() {
  return (
    <div className="App">
      <header>
        <Nav />
        <Snav />
        <Tnav />
        <Fnav />
      </header>

      <Item>
        <Cart />
      </Item>
      <Similar />
      <Footer />

    </div>
  );
}

export default App;
